import React from "react";
import MainMenu from "./MainMenu";
import AccountMenu from "./AccountMenu";
import Logo from "./Logogo";

const MenuBar = () => {
  return ( 
    <div>
        <Logo />
        <MainMenu/>
        <AccountMenu/>
    </div>
   );
}
 
export default MenuBar;
